    [],nt"revision_timestamp": "2016-07-27T23:02:34.567397",nt"name": "1984-walrus-harvest-health-and-welfare-study-at-savoonga-alaska-progress-report",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes walrus harvest data
    that was collected in the spring of 1984 from 26 April to 20 June in Savoonga, Alaska.
    One hundred and forty-four pairs of lower canine teeth were collected from individual
    walruses. Four complete sets of tissue samples, including heart, liver, kidney and
    fat were also collected along with teeth from these animals. Age composition data
    will be compiled through analysis of the teeth samples and tissue samples will be
    analyzed for environmental contaminants. The magnitude and sex ratio of the harvest
    differed from previous years, with a greater number of animals and a higher proportion
    of calves being harvested.",nt"license_title": "License Not Specified",nt"extras":
